import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './MeasurementMenu.scss';

const MeasurementMenu = () => {
  return (
    <div id="measurement-menu">
      <Link to="/">
        <button type="button" className="arrow-button">
          &larr;
        </button>
      </Link>
      <div id="measurement-selection">
        <button type="button" className="button-one">
          LOG WEIGHT
        </button>
        <button type="button" className="button-one">
          LOG WAIST
        </button>
      </div>
    </div>
  );
};

export default MeasurementMenu;
